// src/components/AboutUs.js
import React from 'react';

const About = () => {
  return (
    <section className="bg-gray-100 py-12">
      <div className="container mx-auto px-4">
        <div className="text-center">
          <h2 className="text-3xl font-bold text-gray-800 mb-4">About Us</h2>
          <h2 className="text-3xl font-bold text-gray-800 mb-4">Welcome to BackPack And Explore!</h2>
          <p className="text-gray-600 leading-relaxed">
At BckPack And Explore, we are passionate about adventure and exploration. We believe that the world is full of incredible places waiting to be discovered, and we're here to help you embark on unforgettable journeys.
          </p>
        </div>
      </div>
    </section>
  );
};

export default About;
